import React from "react";
import "./HorizontalneListe.css";

function HorizontalnaLista(props)
{
    
    return(
        <ul>
            
            <li>{props.prvi}</li>
            <li>{props.drugi}</li>
            <li>{props.treci}</li>
            <li>{props.cetvrti}</li>
        </ul>
    );
}

export default HorizontalnaLista;
